import * as React from "react"
const Smiley = (props) => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    id="Layer_2"
    viewBox="0 0 761.93 761.93"
    {...props}
  >
    <defs>
      <style>{".cls-2{stroke-width:0;fill:#080a19}"}</style>
    </defs>
    <g id="Layer_1-2">
      <circle
        id="face"
        cx={380.96}
        cy={380.96}
        r={380.96}
        style={{
          strokeWidth: 0,
          fill: "#51e07d",
        }}
      />
      <path
        d="M289.13 398.69c-8.05 0-14.49 6.8-13.94 14.83 5.21 77.01 50.58 137.21 105.78 137.21s100.57-60.2 105.78-137.21c.54-8.03-5.89-14.83-13.94-14.83H289.13Z"
        className="cls-2"
        id="mouth"
      />
      <circle cx={248.38} cy={248.38} r={19.56} id="right-eye"
        style={{
          strokeWidth:0,
          fill:'#080a19',
          scale:1
        }}
      />
      <circle cx={510.48} cy={248.38} r={19.56} className="cls-2" id="left-eye"/>
    </g>
  </svg>
)
export default Smiley
